import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';

const flname = "Narmeen";


ReactDOM.render(
  <>
  <h1>My name is {flname} </h1>
  <p>MY fav  number is {Math.random()}</p>
  <p>My lucky number is {1+2}</p>
  </>
  ,
  document.getElementById("root")

);
